import { Outlet } from "react-router-dom";
import MainNavigation from "../components/MainNavigation";
import styles from "./RootLayout.module.css";
const RootLayout = () => {
  return (
    <div className={styles.content}>
      <MainNavigation />
      <Outlet />
    </div>
  );
};

export default RootLayout;
